import Feature from "../components/features/Feature";
import Functions from "../components/function/function";
import Navbar from "../components/navbar/navbar";
import './App.css';
// import { Container, Box } from "@mui/material";

function App() {

  const toTop = {
    "color": "black", 
    position: "fixed",
    right: "40px", 
    bottom: "25px",
    "background": "black"
  }

  return(
    <div className="App">
        <Navbar/>
        <Feature/>
        <Functions/>

        <a href="# " uk-totop="true" uk-scroll="true" style={toTop}> </a>

    </div>
  );
}

export default App;
